import React from 'react';
import ReactDOM from 'react-dom';

function getDays(){
    console.log("fetching python");
    fetch('localhost:5000/love', {
        method: 'GET',
        dataType: 'json'
    })
    .then(function(response){
        console.log(response.json());
        let r = response.json();
        console.log(JSON.stringify(r));
    })
    }

console.log(getDays());
